e":"Cisco Packet Tracer - VLANs com Trunk","lengthSeconds":"888","channelId":"UCPd3Yb39Txppdm9DETlWmgg","isOwnerViewing":false,"shortDescription":"Uma VLAN (Virtual Local Area Network) é uma rede virtual que permite que dispositivos em diferentes locais físicos sejam agrupados em uma única rede lógica.\n\nUma VLAN é criada por meio de software pelo que é necessário um Switch com especificidades técnicas que permitam a configuração de VLANs.\n\nAs VLANs são utilizadas para dividir uma rede em diferentes grupos de dispositivos com base em funções, departamentos ou locais físicos. Ao segmentar a rede em VLANs, é possível implementar políticas de segurança entre outras ações.\n\nO que é uma porta Trunk?\nUma porta trunk é projetada para carregar várias VLANs (Virtual LANs) ao mesmo tempo, permitindo que os dados das VLANs sejam transmitidos através de uma única porta. Normalmente, as portas trunk são usadas para ligar switches a outros switches, routers ou servidores que precisam aceder a várias VLANs.\n\nO Packet Tracer é um software desenvolvido pela Cisco e amplamente adotado para o ensino e aprendizagem de Redes de Computadores. É habitualmente usado em escolas técnicas e em universidades pelo facto de permitir a simulação de um ambiente de rede (LAN e WAN) sem a necessidade de utilizar equipamentos e dispositivos físicos reais - que obrigam a orçamentos elevados e a laboratórios de dimensões bastante grandes.","isCrawlable":true,"thumbnail":{"thumbnails":[{"url":"https://i.ytimg.com/vi/01Q_nonAg_Y/hqdefault.jpg?sqp=-oaymwEbCKgBEF5IVfKriqkDDggBFQAAiEIYAXABwAEG\u0026rs=AOn4CLCpgzwiMru51nOTIdKyDIY4koTrHQ","width":168,"height":94},{"url":"https://i.ytimg.com/vi/01Q_nonAg_Y/hqdefault.jpg?sqp=-oaymwEbCMQBEG5IVfKriqkDDggBFQAAiEIYAXABwAEG\u0026rs=AOn4CLB_PYaQ3R2mST3r3dXBOtckfV3xPQ","width":196,"height":110},{"url":"https://i.ytimg.com/vi/01Q_nonAg_Y/hqdefault.jpg?sqp=-oaymwEcCPYBEIoBSFXyq4qpAw4IARUAAIhCGAFwAcABBg==\u0026rs=AOn4CLDQ9V0zcbjBbP-eDFFBlzSM-TsQCA","width":246,"h  (Virtual Local Area Network) é uma rede virtual que permite que dispositivos em diferentes locais físicos sejam agrupados em uma única rede lógica.\n\nUma VLAN é criada por meio de software pelo que é necessário um Switch com especificidades técnicas que permitam a configuração de VLANs.\n\nAs VLANs são utilizadas para dividir uma rede em diferentes grupos de dispositivos com base em funções, departamentos ou locais físicos. Ao segmentar a rede em VLANs, é possível implementar políticas de segurança entre outras ações.\n\nO que é uma porta Trunk?\nUma porta trunk é projetada para carregar várias VLANs (Virtual LANs) ao mesmo tempo, permitindo que os dados das VLANs sejam transmitidos através de uma única porta. Normalmente, as portas trunk são usadas para ligar switches a outros switches, routers ou servidores que precisam aceder a várias VLANs.\n\nO Packet Tracer é um software desenvolvido pela Cisco e amplamente adotado para o ensino e aprendizagem de Redes de Computadores. É habitualmente usado em escolas técnicas e em universidades pelo facto de permitir a simulação de um ambiente de rede (LAN e WAN) sem a necessidade de utilizar equipamentos e dispositivos físicos reais - que obrigam a orçamentos elevados e a laboratórios de dimensões bastante grandes.","styleRuns":[{"startIndex":0,"length":1277,"styleRunExtensions":{"styleRunColorMapExtension":{"colorMap":[{"key":"USER_INTERFACE_THEME_DARK","value":4294967295},{"key":"USER_INTERFACE_THEME_LIGHT","value":4279440147}]}},"fontFamilyName":"Roboto"}]},"headerRuns":[{"startIndex":0,"length":1277,"headerMapping":"ATTRIBUTED_STRING_HEADER_MAPPING_UNSPECIFIED"}]}},{"itemSectionRenderer":{"contents":[{"commentsEntryPointHeaderRenderer":{"headerText":{"runs":[{"text":"Comentários"}]},"onTap":{"clickTrackingParams":"CJQDEMaJBRgAIhMI9_ej1ILZhgMVtizxBR1vUQmU","commandExecutorCommand":{"commands":[{"clickTrackingParams":"CJQDEMaJBRgAIhMI9_ej1ILZhgMVtizxBR1vUQmU","changeEngagementPanelVisibilityAction":{"targetId":"engagemen
